$( document ).ready( function () {
	/*MainMenu SetUp
	================*/
	$( '.mainmenu' ).find( 'li:has(ul)' ).addClass( 'has-menu' );
	$( '.menu_indicator' ).stop().animate( {
		'opacity': '0'
	}, 1 );
	$( '.sub_menu' ).animate( {
		'opacity': '0'
	}, 1 );
	$( '.mobile_menu' ).html( $( '.mainmenu' ).html() );
	$( '.mobile_menu' ).find( 'li.sep' ).remove();

	/*MainMenu Hover FX
	===================*/
	$( '.mainmenu > li' ).hover( function () {
		nav_offset = $( '.head_nav' ).offset();
		offset = $( this ).offset();
		cur_lt = offset.left - nav_offset.left;
		cur_top = offset.top - nav_offset.top;
		$( '.menu_indicator' ).stop().animate( {
			'opacity': '1',
			'left': cur_lt + 'px',
			'top': cur_top + 'px'
		}, 400 );
		$( this ).children( 'a' ).stop().animate( {
			'color': '#195588'
		}, 300 );
	}, function () {
		$( this ).children( 'a' ).stop().animate( {
			'color': '#555555'
		}, 300 );
	} );
	$( '.mainmenu' ).mouseleave( function () {
		$( '.menu_indicator' ).stop().animate( {
			'opacity': '0'
		}, 300 );
	} );

	/*SubMenu Script
	================*/
	$( '.mainmenu' ).find( 'li.has-menu' ).hover( function () {
		showed_menu = $( this ).children( '.sub_menu' );
		showed_menu.css( 'display', 'block' );
		showed_menu.stop().animate( {
			'opacity': '1'
		}, 300 );
	}, function () {
		showed_menu = $( this ).children( '.sub_menu' );
		showed_menu.stop().animate( {
			'opacity': '0'
		}, 300, function () {
			$( this ).css( 'display', 'none' );
		} );
	} );

	/*MobileMenu Scripts
	====================*/
	$( '.menu_toggle' ).click( function () {
		$( this ).toggleClass( 'act' );
		$( '.mobile_menu' ).slideToggle();
	} );

	/*Testimonials select skip
	=======================*/
	$( '#testimonial-filter' ).change( function () {
		var selected = $( '#testimonial-filter option:selected' ).val();
		if ( window.console ) console.log( selected );
		if ( selected !== '' ) {
			if ( window.console ) console.log( '#' + selected );
			$( '#' + selected ).focus();
			$( window ).scrollTop( $( '#' + selected ).offset().top );
		}
	} );



	$( '#contact-us form' ).submit( function () {

		// update user interface
		$( '#contact-us .response' ).html( 'Processing...' );
		$( '#contact-us form input[type="submit"]' ).val( 'Sending...' );

		// Prepare query string and send AJAX request
		$.ajax( {
			url: 'site-handlers/contact-us.php',
			data: 'ajax=true&name=' + escape( $( '#name' ).val() ) +
				'&email=' + escape( $( '#email' ).val() ) +
				'&org=' + escape( $( '#org' ).val() ) +
				'&phone=' + escape( $( '#phone' ).val() ) +
				'&message=' + escape( $( '#message' ).val() ),
			success: function ( msg ) {
				$( '#contact-us .response' ).html( msg );
				if ( msg.substr( 0, 5 ) === 'Error' ) {
					$( '#contact-us input[type="submit"]' ).val( 'Try again!' );
				} else {
					$( '#contact-us input' ).val( '' );
					$( '#contact-us input[type="submit"]' ).val( 'All done!' );
				}
			}
		} );

		return false;
	} );

	// Image gallery stuff
	function gallery() {
		if ( window.console ) console.log( 'g' );
		var Gallery = {

			init: function ( config ) {
				this.trigger = config.trigger;
				this.hook = config.hook;
				this.gallery = config.gallery;
				this.galleryInner = config.galleryInner;
				this.next = config.next;
				this.prev = config.prev;
				this.close = config.close;
				this.dirClass = config.dirClass;
				this.gotoClose = config.gotoClose;
				this.current = 0;
				this.gEvents();
			},

			getGallery: function ( img ) {

				// Prepare query string and send AJAX request
				$.ajax( {
					context: this,
					url: 'gallery-snippet.html',
					success: function ( data, msg ) {
						if ( msg.substr( 0, 5 ) === 'Error' ) {
							// if ( window.console ) console.log( 'uh-oh!' );
						} else {
							this.hook.append( data );
							this.getImage( img );
						}
					}
				} );

			},

			getImage: function ( img ) {

				// Get rid of current for existing images
				$( this.galleryInner ).find( 'li' ).removeClass( 'current slide-first slide-second' );

				// Look for existence of image in the gallery already
				var imgSelector = '#' + img.slice( 0, -4 ),
					_this = this,
					insert = 0;

				if ( window.console ) console.log( imgSelector + ' <<< imgSelector' );

				// If the image doesn't exist yet create a list item and append in the right position
				// If it already exists just switch classes
				if ( !$( imgSelector ).length ) {
					var li = $( '<li>', {
						html: $( new Image() ).attr( 'src', 'img/art/' + img ),
						id: img.slice( 0, -4 ),
						'data-order': this.current
					} );

					$( this.galleryInner ).find( 'li' ).each( function ( i ) {

						if ( parseInt( $( this ).data( 'order' ) ) > _this.current ) {
							insert = i + 1;
							li.insertBefore( $( this ) );
							return false;
						}
					} );
					if ( parseInt( insert ) === 0 ) {
						$( this.galleryInner ).append( li );
					}

				}
				$( imgSelector ).addClass( 'current ' + this.dirClass );

				this.checkControls();

			},

			checkControls: function () {

				// Check if the Prev control is needed
				if ( window.console ) console.log( this.current + ' <<<< current' );
				if ( this.current === 1 ) {
					$( this.prev ).addClass( 'gone' );
				} else {
					$( this.prev ).removeClass( 'gone' );
				}

				// Check if the Next control is needed
				if ( this.current === 24 ) {
					$( this.next ).addClass( 'gone' );
				} else {
					$( this.next ).removeClass( 'gone' );
				}

				// Choose which heading to display
				$( 'h1.ian, h1.squid' ).addClass( 'gone' );
				if ( parseInt( this.current ) > 12 ) {
					$( 'h1.ian' ).removeClass( 'gone' );
				} else {
					$( 'h1.squid' ).removeClass( 'gone' );
				}

			},

			gEvents: function () {

				var _this = this;

				// Open the gallery

				$( 'body' ).on( 'click', _this.trigger, function ( event ) {
					event.preventDefault();

					if ( window.console ) console.log( 'Make that mofo image gallery show up' );

					_this.current = $( this ).data( 'image-order' );

					var img = $( this ).data( 'image-gallery' );

					// go get the gallery snippet if it doesn't already exist
					if ( !$( _this.gallery ).length ) {
						_this.getGallery( img );
					} else {
						$( _this.gallery ).removeClass( 'gone' );
						_this.getImage( img );
						_this.checkControls();
					}

				} );

				// Close the gallery

				$( 'body' ).on( 'click', _this.close, function ( event ) {
					event.preventDefault();
					$( _this.gallery ).addClass( 'gone' );

					// Move the Artists section back to top on closing the gallery
					$( 'html, body' ).animate( {
						scrollTop: $( _this.gotoClose ).offset().top
					}, 0 );

				} );

				// Previous image

				$( 'body' ).on( 'click', _this.prev, function ( event ) {
					event.preventDefault();
					_this.current -= 1;
					_this.dirClass = 'slide-first';
					$( _this.trigger ).each( function ( i ) {
						if ( parseInt( $( this ).data( 'image-order' ) ) === _this.current ) {
							_this.getImage( $( this ).data( 'image-gallery' ) );
						}
					} );
				} );

				// Next image

				$( 'body' ).on( 'click', _this.next, function ( event ) {
					event.preventDefault();
					_this.current += 1;
					_this.dirClass = 'slide-second';
					$( _this.trigger ).each( function ( i ) {
						if ( parseInt( $( this ).data( 'image-order' ) ) === _this.current ) {
							_this.getImage( $( this ).data( 'image-gallery' ) );
						}
					} );

				} );

				$( document ).keyup( function ( e ) {

					if ( e.keyCode == 27 ) {

						$( _this.gallery ).addClass( 'gone' );

						// Move the Artists section back to top on closing the gallery
						$( 'html, body' ).animate( {
							scrollTop: $( _this.gotoClose ).offset().top
						}, 0 );
					} // escape key maps to keycode `27`
				} );

			}

		};

		Gallery.init( {
			trigger: '.work-block a',
			gallery: '.mod-gallery',
			hook: $( '.mod-artist-group' ),
			galleryInner: '.mod-gallery-inner ul',
			next: '.mod-gallery-next',
			prev: '.mod-gallery-prev',
			close: '.mod-gallery-close',
			dirClass: 'slide-second',
			gotoClose: '#artists',
		} );

	}

	if ( window.console ) console.log( 'blag' );
	gallery();


} );
$( document ).ready( function () {
	/*Input and Textarea Click-Clear
	================================*/
	$( 'input[type=text]' ).focus( function () {
		if ( $( this ).attr( 'readonly' ) || $( this ).attr( 'readonly' ) == 'readonly' ) return false;
		if ( $( this ).val() === $( this ).attr( 'title' ) ) {
			$( this ).val( '' );
		}
	} ).blur( function () {
		if ( $( this ).attr( 'readonly' ) || $( this ).attr( 'readonly' ) == 'readonly' ) return false;
		if ( $( this ).val().length === 0 ) {
			$( this ).val( $( this ).attr( 'title' ) );
		}
	} );
	$( 'textarea' ).focus( function () {
		if ( $( this ).text() === $( this ).attr( 'title' ) ) {
			$( this ).text( '' );
		}
	} ).blur( function () {
		if ( $( this ).text().length === 0 ) {
			$( this ).text( $( this ).attr( 'title' ) );
		}
	} );

	/*Activate PrettyPhoto
	=======================*/
	if ( $( 'a.prettyPhoto' ).length ) {
		$( 'a.prettyPhoto' ).prettyPhoto( {
			default_width: 600,
			social_tools: false /* html or false to disable */
		} );
	}

	/*Toggles List
	===============*/
	$( 'ul.toggles' ).find( 'span' ).click( function () {
		$( this ).parents( 'li' ).find( 'div.toggle_text' ).slideToggle();
		$( this ).parents( 'li' ).toggleClass( 'act' );
	} );

	/*Accordion
	===========*/
	$( ".accordion" ).accordion();

	/*Image Inner Border*/
	$( 'img.bordered1' ).each( function () {
		curr_w = $( this ).width();
		curr_h = $( this ).height();
		// $(this).css({'width' : (curr_w-6)+'px', 'height' : (curr_h-6)+'px'});
	} );
	$( 'img.bordered1' ).hover( function () {
		$( this ).stop().animate( {
			'border-color': '#d71d28'
		} );
	}, function () {
		$( this ).stop().animate( {
			'border-color': '#eaeaea'
		} );
	} );
} );

